INSERT INTO `news` VALUES (1,'Khuyến khích trồng cây xanh trong khu dân cư','Việc trồng cây xanh giúp cải thiện môi trường sống và nâng cao chất lượng không khí.','Trong những năm gần đây, ô nhiễm không khí ngày càng gia tăng, đặc biệt tại các khu đô thị đông dân cư. Việc trồng thêm cây xanh không chỉ giúp giảm nhiệt độ môi trường mà còn góp phần hấp thụ khí CO₂ và bụi mịn. Mỗi người dân có thể bắt đầu bằng những hành động nhỏ như trồng cây trước nhà, trên ban công hoặc tham gia các hoạt động trồng rừng cộng đồng để chung tay bảo vệ môi trường sống.','/uploads/1769766271700-429763127.jpg','2026-01-30 09:44:31','2026-02-07 04:01:48'),(2,'Lợi ích của cây xanh đối với sức khỏe con người','Cây xanh mang lại nhiều lợi ích tích cực cho cả sức khỏe thể chất lẫn tinh thần.','Nhiều nghiên cứu cho thấy môi trường sống có nhiều cây xanh giúp giảm căng thẳng, cải thiện tâm trạng và tăng khả năng tập trung. Cây xanh còn giúp lọc không khí, giảm tiếng ồn và tạo không gian sống trong lành hơn. Việc dành thời gian chăm sóc cây mỗi ngày cũng là một cách thư giãn hiệu quả sau những giờ làm việc căng thẳng.','/uploads/1769766293933-465392064.jpg','2026-01-30 09:44:53','2026-02-07 04:01:48'),(3,'Hành động nhỏ vì môi trường xanh bền vững.','Mỗi cá nhân đều có thể góp phần xây dựng môi trường xanh bằng những việc làm đơn giản...','Bảo vệ môi trường không nhất thiết phải bắt đầu từ những hành động lớn. Chỉ cần trồng một cây xanh, hạn chế sử dụng túi nilon hoặc tiết kiệm nước mỗi ngày cũng đã góp phần tạo nên sự thay đổi tích cực. Khi mỗi người cùng nâng cao ý thức bảo vệ môi trường, chúng ta sẽ xây dựng được một không gian sống xanh – sạch – đẹp cho thế hệ hiện tại và tương lai.','/uploads/1769766316396-136741188.jfif','2026-01-30 09:45:16','2026-02-07 04:05:10');
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
UNLOCK TABLES;

